#slide_wrapper {
	width: 750px;
	height: 429px;
}

#slides {
	overflow: hidden;
	/* fix ie overflow issue */
	position: relative;
	width: 750px;
	height: 429px;
}

/* remove the list styles, width : item width * total items */	
#slides ul {
	position:relative;
	left:0;
	top:0;
	list-style:none;
	margin:0;
	padding:0;	
	width: 2250px;
	height: 429px;		
}

/* width of the item, in this case I put 250x250x gif */
#slides li {
	width: 750px;
	height: 429px;
	float:left;
}

#slides li img {
	width: 750px;
	height: 429px;
}

@media only screen and (max-width: 1366px) {

	#slide_wrapper {
		width: 600px;
		height: 343px;
	}
	
	#slides {
		overflow: hidden;
		/* fix ie overflow issue */
		position: relative;
		width: 600px;
		height: 343px;
	}
	
	/* remove the list styles, width : item width * total items */	
	#slides ul {
		position:relative;
		left:0;
		top:0;
		list-style:none;
		margin:0;
		padding:0;	
		width: 1800px;
		height: 343px;		
	}
	
	/* width of the item, in this case I put 250x250x gif */
	#slides li {
		width: 600px;
		height: 343px;
		float:left;
	}
	
	#slides li img {
		width: 600px;
		height: 343px;
		margin-left: 0;
	}

}

// Avoid `console` errors in browsers that lack a console.
(function() {
    var method;
    var noop = function () {};
    var methods = [
        'assert', 'clear', 'count', 'debug', 'dir', 'dirxml', 'error',
        'exception', 'group', 'groupCollapsed', 'groupEnd', 'info', 'log',
        'markTimeline', 'profile', 'profileEnd', 'table', 'time', 'timeEnd',
        'timeStamp', 'trace', 'warn'
    ];
    var length = methods.length;
    var console = (window.console = window.console || {});

    while (length--) {
        method = methods[length];

        // Only stub undefined methods.
        if (!console[method]) {
            console[method] = noop;
        }
    }
}());

