function animateBulbs() {
	if (bulbsStarted == false) {
		bulbsStarted = true;
		if (pageName == 'home') {
			bulbTo = 8;	
		}
		else {
			bulbTo = 7;
		}
		for (var i=1;i<bulbTo;i++) {
			clearInterval(animationInterval[i]);
			if (pageName == 'home') {
				$("#bulb" + i).css("opacity",'0');
			}
			else {
				$("#bulb" + i + "_subpage").css("opacity",'0');
			}
			thisOpacity[i] = 0.0;
			thisDirection[i] = 'f';
		}
		
		var animation1 = setInterval("animateBulb()",300);
		//var animation2 = setTimeout("animateBulb(2)",500);
		//var animation3 = setTimeout("animateBulb(3)",900);
		//var animation4 = setTimeout("animateBulb(4)",1300);	
		//var animation5 = setTimeout("animateBulb(5)",1700);
		//var animation6 = setTimeout("animateBulb(6)",2100);
		//if (pageName == 'home') {
			//var animation7 = setTimeout("animateBulb(7)",2500);
		//}
	}
}

function animateBulb() {
	var switchBulb = false;
	if (thisDirection[bulbno] == 'f') {
		thisOpacity[bulbno] = thisOpacity[bulbno] + 0.1;
		if (pageName == 'home') {
			$("#bulb" + bulbno).css("opacity",thisOpacity[bulbno]);
		}
		else {
			$("#bulb" + bulbno + "_subpage").css("opacity",thisOpacity[bulbno]);
		}
		if (thisOpacity[bulbno] > 0.4) {
			thisDirection[bulbno] = 'r';
		}
	}
	else {
		thisOpacity[bulbno] = thisOpacity[bulbno] - 0.1;
		if (pageName == 'home') {
			$("#bulb" + bulbno).css("opacity",thisOpacity[bulbno]);
		}
		else {
			$("#bulb" + bulbno + "_subpage").css("opacity",thisOpacity[bulbno]);
		}
		if (thisOpacity[bulbno] < 0.01) {
			thisDirection[bulbno] = 'f';
			switchBulb = true;
		}	
	}
	if (switchBulb)
	{
		if (bulbno == 7)
		{
			bulbno = 1;	
		}
		else
		{
			bulbno ++;	
		}
		switchBulb = false;
	}
	//clearInterval(animationInterval[bulbno]);
	//animationInterval[bulbno] = setInterval("animateBulb(" + bulbno + ")",100);
}

function unanimateBulbs() {
	bulbsStarted = false;
	if (pageName == 'home') {
		bulbTo = 8;	
	}
	else {
		bulbTo = 7;
	}
	for (var i=1;i<bulbTo;i++) {
		clearInterval(animationInterval[i]);
		if (pageName == 'home') {
			$("#bulb" + i).css("opacity",'0');
		}
		else {
			$("#bulb" + i + "_subpage").css("opacity",'0');
		}
	}
}

function flipArrow() {
	arrowPic = $('#arrow_lights').attr('src');
	if (arrowPic == 'img/party_light_off.gif' || arrowPic == '/img/party_light_off.gif') {
		document.getElementById('arrow_lights').src = '/img/party_light_on.gif';
	}
	else {
		document.getElementById('arrow_lights').src = '/img/party_light_off.gif';
	}
}

function animateLogo() {
	if (seagullMoving == false && screen.width > 720) {
		theSeagull = setInterval(animateBird,50);
	}
}

function clearFormField(em) {
	if (em.value == 'Find Locations by City/State/Zip' || em.value == 'Enter City & State or Zip' || em.value == 'Enter your email address' || em.value == 'Enter Card Number') {
		em.value = '';
	}
}

function animateBird() {
	seagullMoving = true;
	bird = document.getElementById('bird_flying');
	birdPos = birdPos+2;
	bird.style.left = birdPos + 'px';
	bird.style.visibility = 'visible';
	if (bird.style.left.replace('px','') == screen.width) {
		unanimateBird();	
	}
}

function unanimateBird() {
	clearInterval(theSeagull);
	seagullMoving = false;
	bird = document.getElementById('bird_flying');
	bird.style.visibility = 'hidden';
	bird.style.left = '-100px';
	birdPos = -100;
}

function openCloseMobileMenu() {
	mobileArrowTop = document.getElementById('mobile_links_popup');
	mobileArrowBottom = document.getElementById('mobile_links_popup_bottom');
	mobileMenu = document.getElementById('mobile_popup_menu');
	if (mobileMenuOpened == false) {
		mobileArrowTop.className = 'invisible mobile';
		mobileMenu.className = 'visible mobile';
		mobileArrowBottom.className = 'visible mobile';
		mobileMenuOpened = true;
	}
	else {
		mobileArrowTop.className = 'visible mobile';
		mobileMenu.className = 'invisible mobile';
		mobileArrowBottom.className = 'invisible mobile';
		mobileMenuOpened = false;
	}
}

function openCloseLocationInfo(detailDivID) {
	clickableDiv = document.getElementById('locinfo_' + detailDivID);
	detailDiv = document.getElementById('locinfo_details_' + detailDivID);
	if (detailDiv.className == 'view_location_info_inner white_text_medium invisible') {
		clickableDiv.innerHTML = '&nbsp;&mdash; View Info';
		detailDiv.className = 'view_location_info_inner white_text_medium visible';
	}
	else {
		clickableDiv.innerHTML = '&nbsp;+ View Info';
		detailDiv.className = 'view_location_info_inner white_text_medium invisible';	
	}
}

function printFrame(id) {
	var frm = document.getElementById(id).contentWindow;
	frm.focus();// focus on contentWindow is needed on some ie versions
	frm.print();
}


//Geolocation code
function geo_error(err) {
	if (err.code == 1) {
		alert('The user denied the request for location information.');
		$('#mask').remove();
	} else if (err.code == 2) {
		alert('Your location information is unavailable.');
		$('#mask').remove();
	} else if (err.code == 3) {
		alert('The request to get your location timed out.');
		$('#mask').remove();
	} else if (err.code == error.PERMISSION_DENIED) {
		$('#mask').remove();
	} else {
		error('An unknown error occurred while requesting your location.');
	}
};

function geo_success(position) {
	$('#search_coords').val(position.coords.latitude.toString() + "," + position.coords.longitude.toString());
	$('#search_coords_locator').val(position.coords.latitude.toString() + "," + position.coords.longitude.toString());
	//Not necessary but in place for good measure
	$('input[name="searchtext"]').val("");
	$('#locator').submit();
}

$('.geo_locator').click(function (e) {
	if (navigator && navigator.geolocation) {
		//functions for chrome FF 3.5+ and IE 9
		var maskHeight = $(window).height();
		var maskWidth = $(document).width();
		//Take out overflowY kv pair if you want to allow scrolling
		$('#mask').css({ width: '100%', height: '100%',
			overflowY: 'hidden'
		});
		$('#mask').fadeIn(1000);
		$('#mask').fadeTo("slow", 0.8);
		$('#mask').append("<a href='#' class='cancel-geosearch'>Cancel</a>");
		$('.cancel-geosearch').css({ 'position': 'relative', 'top': '63%', 'left': '49%', 'font-size': '15px', 'font-decoration': 'none', 'color': 'white' });
		$('.cancel-geosearch').click(function (e) {
			$('#mask').fadeOut();
			$(this).remove();
		});
		navigator.geolocation.getCurrentPosition(geo_success, geo_error);
		e.preventDefault();
	}
});

